INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 0, "", 1, 1, 1, 0, 0, 190804, 60000, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60000, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60000, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 3);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 1, 0, 0, 60000, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 4);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60000, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 5);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60000, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 6);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 2, 0, 0, 60000, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 7);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60000, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 8);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60000, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 9);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60000, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 10);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60000, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 11);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 3, 0, 0, 60000, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 12);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60000, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 13);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60000, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 14);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60000, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 15);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60000, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 16);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 4, 0, 0, 60000, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 17);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 0, "", 3, 2, 0, 0, 0, 190804, 60000, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 18);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 7, "", 3, 3, 0, 0, 0, 190804, 60000, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 19);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ハツネ", 1, "", 0, 1, 0, 0, 0, 101201, 80001, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 20);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ハツネ", 1, "", 0, 2, 0, 0, 0, 101201, 80001, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 21);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シオリ", 1, "", 1, 1, 0, 0, 0, 103801, 80001, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 22);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シオリ", 1, "", 1, 2, 0, 0, 0, 103801, 80001, "来年も、\n一緒にいられたら…\nうれしいな", 23);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キョウカ", 2, "", 0, 1, 0, 0, 0, 103601, 80001, "あなたと一緒にいるようになって、\nもう1年ですか…", 24);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キョウカ", 2, "", 0, 2, 0, 0, 0, 103601, 80001, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 25);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミミ", 2, "", 1, 1, 0, 0, 0, 102001, 80001, "おにいちゃんとあってから、\n1年たったよ～！", 26);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミミ", 2, "", 1, 2, 0, 0, 0, 102001, 80001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 27);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミソギ", 2, "", 2, 1, 0, 0, 0, 100401, 80001, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 28);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミソギ", 2, "", 2, 2, 0, 0, 0, 100401, 80001, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 29);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("マホ", 3, "", 0, 1, 0, 0, 0, 101001, 80001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 30);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("マホ", 3, "", 0, 2, 0, 0, 0, 101001, 80001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 31);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("イリヤ", 3, "", 1, 1, 0, 0, 0, 104401, 80001, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 32);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("イリヤ", 3, "", 1, 2, 0, 0, 0, 104401, 80001, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 33);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カオリ", 3, "", 2, 1, 0, 0, 0, 101701, 80001, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 34);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カオリ", 3, "", 2, 2, 0, 0, 0, 101701, 80001, "これからも、どうぞよろしく\nお願いするさ～！", 35);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("サレン", 4, "", 0, 1, 0, 0, 0, 102801, 80001, "あんたと出会ってからもうそんなに\nたつのね～", 36);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("サレン", 4, "", 0, 2, 0, 0, 0, 102801, 80001, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 37);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("スズメ", 4, "", 1, 1, 0, 0, 0, 102501, 80001, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 38);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("スズメ", 4, "", 1, 2, 0, 0, 0, 102501, 80001, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 39);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("タマキ", 5, "", 0, 1, 0, 0, 0, 104601, 80001, "振り返れば、今までいろんなことが\nあったにゃあ…", 40);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("タマキ", 5, "", 0, 2, 0, 0, 0, 104601, 80001, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 41);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミフユ", 5, "", 1, 1, 0, 0, 0, 104801, 80001, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 42);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミフユ", 5, "", 1, 2, 0, 0, 0, 104801, 80001, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 43);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("アキノ", 6, "", 0, 1, 0, 0, 0, 103201, 80001, "あなたさまと出会ってもう1年…", 44);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("アキノ", 6, "", 0, 2, 0, 0, 0, 103201, 80001, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 45);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ユカリ", 6, "", 1, 1, 0, 0, 0, 103401, 80001, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 46);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ユカリ", 6, "", 1, 2, 0, 0, 0, 103401, 80001, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 47);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("クリスティーナ", 7, "", 0, 1, 0, 0, 0, 107101, 80001, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 48);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("クリスティーナ", 7, "", 0, 2, 0, 0, 0, 107101, 80001, "ともかくこれからも\n愉しませてくれよ☆", 49);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ジュン", 7, "", 1, 1, 0, 0, 0, 104701, 80001, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 50);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ジュン", 7, "", 1, 2, 0, 0, 0, 104701, 80001, "見えないから分からないって？\nそれもそうだな…", 51);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("トモ", 8, "", 0, 1, 0, 0, 0, 103701, 80001, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 52);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("トモ", 8, "", 0, 2, 0, 0, 0, 103701, 80001, "これからもよろしくね！", 53);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("マツリ", 8, "", 1, 1, 0, 0, 0, 100501, 80001, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 54);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("マツリ", 8, "", 1, 2, 0, 0, 0, 100501, 80001, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 55);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミヤコ", 9, "", 0, 1, 0, 0, 0, 100701, 80001, "オマエと会って1年なの！\n全然成仏もできなかったし、", 56);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミヤコ", 9, "", 0, 2, 0, 0, 0, 100701, 80001, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 57);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シノブ", 9, "", 1, 1, 0, 0, 0, 103101, 80001, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 58);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シノブ", 9, "", 1, 2, 0, 0, 0, 103101, 80001, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 59);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("アンナ", 10, "", 0, 1, 0, 0, 0, 100901, 80001, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 60);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("アンナ", 10, "", 0, 2, 0, 0, 0, 100901, 80001, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 61);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ナナカ", 10, "", 1, 1, 0, 0, 0, 101301, 80001, "君と出会ってもう1年だって！\n早いねー！", 62);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ナナカ", 10, "", 1, 2, 0, 0, 0, 101301, 80001, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 63);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミツキ", 11, "", 0, 1, 0, 0, 0, 105101, 80001, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 64);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ミツキ", 11, "", 0, 2, 0, 0, 0, 105101, 80001, "これからも、いろんなところを\n調べさせてね？", 65);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ルカ", 11, "", 1, 1, 0, 0, 0, 105601, 80001, "お前さんと出会ってもう1年か\n助太刀するつもりが", 66);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ルカ", 11, "", 1, 2, 0, 0, 0, 105601, 80001, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 67);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("エリコ", 11, "", 2, 1, 0, 0, 0, 102701, 80001, "早いものですわね、あなた様と\nお会いして、もう1年…", 68);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("エリコ", 11, "", 2, 2, 0, 0, 0, 102701, 80001, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 69);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("アヤネ", 12, "", 0, 1, 0, 0, 0, 102301, 80001, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 70);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("アヤネ", 12, "", 0, 2, 0, 0, 0, 102301, 80001, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 71);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("チカ", 12, "", 1, 1, 0, 0, 0, 104201, 80001, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 72);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("チカ", 12, "", 1, 2, 0, 0, 0, 104201, 80001, "私のことを見守ってください\nできることなら、ずっと…", 73);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("クルミ", 12, "", 2, 1, 0, 0, 0, 102101, 80001, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 74);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("クルミ", 12, "", 2, 2, 0, 0, 0, 102101, 80001, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 75);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シズル", 13, "", 0, 1, 0, 0, 0, 104901, 80001, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 76);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シズル", 13, "", 0, 2, 0, 0, 0, 104901, 80001, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 77);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("リノ", 13, "", 1, 1, 0, 0, 0, 101101, 80001, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 78);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("リノ", 13, "", 1, 2, 0, 0, 0, 101101, 80001, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 79);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ユイ", 14, "", 0, 1, 0, 0, 0, 100201, 80001, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ユイ", 14, "", 0, 2, 0, 0, 0, 100201, 80001, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 81);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ヒヨリ", 14, "", 1, 1, 0, 0, 0, 100101, 80001, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 82);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ヒヨリ", 14, "", 1, 2, 0, 0, 0, 100101, 80001, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 83);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("レイ", 14, "", 2, 1, 0, 0, 0, 100301, 80001, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 84);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("レイ", 14, "", 2, 2, 0, 0, 0, 100301, 80001, "キミに背中を預けられる日が、\n早くきますように", 85);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 1, 0, 0, 0, 105801, 80001, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 86);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 2, 0, 0, 0, 105801, 80001, "これからもずっと、覚えていて\nくださいね！", 87);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 1, 0, 0, 0, 105901, 80001, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 88);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 2, 0, 0, 0, 105901, 80001, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 89);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 1, 0, 0, 0, 106001, 80001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 90);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 2, 0, 0, 0, 106001, 80001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 91);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("スズメ", 0, "", 1, 1, 1, 0, 0, 112101, 60001, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 92);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60001, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 93);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60001, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 94);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60001, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 95);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60001, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 96);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 1, 0, 0, 60001, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 97);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60001, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 98);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60001, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 99);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60001, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 100);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60001, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 101);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 2, 0, 0, 60001, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 102);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60001, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 103);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60001, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 104);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60001, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 105);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60001, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 106);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60001, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 107);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60001, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 108);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 3, 0, 0, 60001, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 109);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60001, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 110);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60001, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 111);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60001, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 112);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60001, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 113);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60001, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 114);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60001, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 115);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 4, 0, 0, 60001, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 116);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("スズメ", 0, "", 3, 2, 0, 0, 0, 112101, 60001, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 117);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("スズメ", 7, "", 3, 3, 0, 0, 0, 112101, 60001, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 118);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 0, 1, 0, 0, 0, 105801, 80003, "ヒューヒュー♪\nドンドンパフパフー♪", 119);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 1, 1, 0, 0, 0, 105901, 80003, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 120);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 1, 2, 0, 0, 0, 105901, 80003, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 121);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 1, "", 2, 1, 0, 0, 0, 106001, 80003, "え？　ちょっと\nいきなりなにっ？", 122);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 1, "", 2, 2, 0, 0, 0, 106001, 80003, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 123);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 0, 2, 0, 0, 0, 105801, 80003, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 124);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 0, 3, 0, 0, 0, 105801, 80003, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 125);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 1, 3, 0, 0, 0, 105901, 80003, "ですからその日に向けて\n今から気分を盛り上げているのです", 126);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 1, "", 2, 3, 0, 0, 0, 106001, 80003, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 127);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 1, 4, 0, 0, 0, 105901, 80003, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 128);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 0, 4, 0, 0, 0, 105801, 80003, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 129);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 1, "", 2, 4, 0, 0, 0, 106001, 80003, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 130);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 1, 5, 0, 0, 0, 105901, 80003, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 131);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 5, 0, 0, 0, 106001, 80003, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 132);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 2, "", 1, 1, 0, 0, 0, 190801, 80003, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 133);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 6, 0, 0, 0, 106001, 80003, "げっ…カリンじゃない\nなんでもないわよ！", 134);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 2, "", 1, 2, 0, 0, 0, 190801, 80003, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 135);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 7, 0, 0, 0, 106001, 80003, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 136);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 2, "", 1, 3, 0, 0, 0, 190801, 80003, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 137);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 8, 0, 0, 0, 106001, 80003, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 138);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 9, 0, 0, 0, 106001, 80003, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 139);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 2, "", 1, 4, 0, 0, 0, 190801, 80003, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 140);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 10, 0, 0, 0, 106001, 80003, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 141);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 2, "", 1, 5, 0, 0, 0, 190801, 80003, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 142);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 11, 0, 0, 0, 106001, 80003, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 143);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 0, 6, 0, 0, 0, 105901, 80003, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 144);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 1, 5, 0, 0, 0, 105801, 80003, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 145);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 0, 7, 0, 0, 0, 105901, 80003, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 146);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 0, 8, 0, 0, 0, 105901, 80003, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 147);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 1, 6, 0, 0, 0, 105801, 80003, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 148);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 1, 7, 0, 0, 0, 105801, 80003, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 149);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 0, 9, 0, 0, 0, 105901, 80003, "あとは、牧場に素敵な温泉が\n出来たとか…", 150);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 1, 8, 0, 0, 0, 105801, 80003, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 151);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 0, 10, 0, 0, 0, 105901, 80003, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 152);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 1, 9, 0, 0, 0, 105801, 80003, "えへへ、ありがとうございます\nコッコロちゃん！", 153);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 0, 11, 0, 0, 0, 105901, 80003, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 154);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 1, 10, 0, 0, 0, 105801, 80003, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 155);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 0, 11, 0, 0, 0, 105801, 80003, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 156);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 1, 12, 0, 0, 0, 106001, 80003, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 157);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 0, 12, 0, 0, 0, 105801, 80003, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 158);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 1, 13, 0, 0, 0, 106001, 80003, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 159);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 0, 13, 0, 0, 0, 105801, 80003, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 160);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 1, 14, 0, 0, 0, 106001, 80003, "…積極的？\nなんの話よ？", 161);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 0, 14, 0, 0, 0, 105801, 80003, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 162);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 0, 15, 0, 0, 0, 105801, 80003, "ムーサの町で\nきゃるきゃる～ん☆　って！", 163);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 1, 15, 0, 0, 0, 106001, 80003, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 164);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 0, 16, 0, 0, 0, 105801, 80003, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 165);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 1, 16, 0, 0, 0, 106001, 80003, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 166);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 1, 17, 0, 0, 0, 106001, 80003, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 167);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 18, 0, 0, 0, 106001, 80003, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 168);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 5, "", 1, 12, 0, 0, 0, 105901, 80003, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 169);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 19, 0, 0, 0, 106001, 80003, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 170);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 5, "", 1, 13, 0, 0, 0, 105901, 80003, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 171);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 20, 0, 0, 0, 106001, 80003, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 172);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 5, "", 1, 14, 0, 0, 0, 105901, 80003, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 173);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 21, 0, 0, 0, 106001, 80003, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 174);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 5, "", 1, 15, 0, 0, 0, 105901, 80003, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 175);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 22, 0, 0, 0, 106001, 80003, "かくし芸？", 176);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 5, "", 1, 16, 0, 0, 0, 105901, 80003, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 177);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 23, 0, 0, 0, 106001, 80003, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 178);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 6, "", 0, 17, 0, 0, 0, 105801, 80003, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 179);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 2, 24, 0, 0, 0, 106001, 80003, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 180);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 6, "", 1, 17, 0, 0, 0, 105901, 80003, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 181);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 6, "", 0, 18, 0, 0, 0, 105801, 80003, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 182);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 2, 25, 0, 0, 0, 106001, 80003, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 183);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 6, "", 1, 18, 0, 0, 0, 105901, 80003, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 184);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 2, 26, 0, 0, 0, 106001, 80003, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 185);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 2, 27, 0, 0, 0, 106001, 80003, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 186);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 2, 28, 0, 0, 0, 106001, 80003, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 187);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 6, "", 0, 19, 0, 0, 0, 105801, 80003, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 188);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 6, "", 1, 19, 0, 0, 0, 105901, 80003, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 189);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 2, 29, 0, 0, 0, 106001, 80003, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 190);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 30, 0, 0, 0, 106001, 80003, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 191);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 31, 0, 0, 0, 106001, 80003, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 192);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 32, 0, 0, 0, 106001, 80003, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 193);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 33, 0, 0, 0, 106001, 80003, "あー\nあー\n…声、これで大丈夫かしら？", 194);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 34, 0, 0, 0, 106001, 80003, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 195);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 35, 0, 0, 0, 106001, 80003, "オイッスー☆", 196);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 36, 0, 0, 0, 106001, 80003, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 197);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 37, 0, 0, 0, 106001, 80003, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 198);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 38, 0, 0, 0, 106001, 80003, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 199);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 20, 0, 0, 0, 105901, 80003, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 200);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 21, 0, 0, 0, 105901, 80003, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 201);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 22, 0, 0, 0, 105901, 80003, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 202);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 23, 0, 0, 0, 105901, 80003, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 203);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 24, 0, 0, 0, 105901, 80003, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 204);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 25, 0, 0, 0, 105901, 80003, "オイッスー☆", 205);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 26, 0, 0, 0, 105901, 80003, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 206);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 27, 0, 0, 0, 105901, 80003, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 207);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 0, 28, 0, 0, 0, 105901, 80003, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 208);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 20, 0, 0, 0, 105801, 80003, "オイッスー☆", 209);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 21, 0, 0, 0, 105801, 80003, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 210);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 22, 0, 0, 0, 105801, 80003, "あと６日で2.5周年ですか…", 211);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 23, 0, 0, 0, 105801, 80003, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 212);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 24, 0, 0, 0, 105801, 80003, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 213);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 25, 0, 0, 0, 105801, 80003, "オイッスー☆", 214);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 26, 0, 0, 0, 105801, 80003, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 215);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 27, 0, 0, 0, 105801, 80003, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 216);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 28, 0, 0, 0, 105801, 80003, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 217);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 29, 0, 0, 0, 105801, 80003, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 218);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 9, "", 0, 30, 0, 0, 0, 105801, 80003, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 219);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 10, "", 0, 31, 0, 0, 0, 105801, 80003, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 220);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 1, 29, 0, 0, 0, 105901, 80003, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 221);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 10, "", 0, 32, 0, 0, 0, 105801, 80003, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 222);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 10, "", 2, 39, 0, 0, 0, 106001, 80003, "…………", 223);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 1, 30, 0, 0, 0, 105901, 80003, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 224);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 10, "", 2, 40, 0, 0, 0, 106001, 80003, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 225);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 10, "", 0, 33, 0, 0, 0, 105801, 80003, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 226);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 10, "", 2, 41, 0, 0, 0, 106001, 80003, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 227);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 10, "", 0, 34, 0, 0, 0, 105801, 80003, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 228);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 10, "", 0, 35, 0, 0, 0, 105801, 80003, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 229);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 10, "", 2, 42, 0, 0, 0, 106001, 80003, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 230);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 1, 31, 0, 0, 0, 105901, 80003, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 231);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 10, "", 2, 43, 0, 0, 0, 106001, 80003, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 232);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 10, "", 0, 36, 0, 0, 0, 105801, 80003, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 233);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 6, 0, 0, 0, 190801, 80003, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 234);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 7, 0, 0, 0, 190801, 80003, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 235);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 8, 0, 0, 0, 190801, 80003, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 236);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 9, 0, 0, 0, 190801, 80003, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 237);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 10, 0, 0, 0, 190801, 80003, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 238);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 11, 0, 0, 0, 190801, 80003, "次にコッコロさんですが\nこちらは発声練習をしています", 239);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 12, 0, 0, 0, 190801, 80003, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 240);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 13, 0, 0, 0, 190801, 80003, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 241);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 14, 0, 0, 0, 190801, 80003, "あれ？\nもしかして緊張で気を失って…？", 242);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 15, 0, 0, 0, 190801, 80003, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 243);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 16, 0, 0, 0, 190801, 80003, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 244);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 11, "", 0, 17, 0, 0, 0, 190801, 80003, "それでは\nまた明日お会いしましょう♪", 245);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 12, "", 0, 44, 0, 0, 0, 106001, 80003, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 246);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 12, "", 2, 37, 0, 0, 0, 105801, 80003, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 247);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 12, "", 1, 32, 0, 0, 0, 105901, 80003, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 248);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 12, "", 0, 45, 0, 0, 0, 106001, 80003, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 249);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 12, "", 2, 38, 0, 0, 0, 105801, 80003, "ひどいですよぉキャルちゃ～ん！", 250);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 12, "", 1, 33, 0, 0, 0, 105901, 80003, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 251);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 12, "", 2, 39, 0, 0, 0, 105801, 80003, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 252);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 12, "", 0, 46, 0, 0, 0, 106001, 80003, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 253);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 12, "", 1, 34, 0, 0, 0, 105901, 80003, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 254);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 12, "", 2, 40, 0, 0, 0, 105801, 80003, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 255);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 0, 41, 0, 0, 0, 105801, 80003, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 256);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 47, 0, 0, 0, 106001, 80003, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 257);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 0, 42, 0, 0, 0, 105801, 80003, "忘れてきちゃいました☆", 258);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 48, 0, 0, 0, 106001, 80003, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 259);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 13, "", 1, 35, 0, 0, 0, 105901, 80003, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 260);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 49, 0, 0, 0, 106001, 80003, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 261);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 0, 43, 0, 0, 0, 105801, 80003, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 262);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 50, 0, 0, 0, 106001, 80003, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 263);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 13, "", 1, 36, 0, 0, 0, 105901, 80003, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 264);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 51, 0, 0, 0, 106001, 80003, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 265);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 13, "", 1, 37, 0, 0, 0, 105901, 80003, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 266);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 52, 0, 0, 0, 106001, 80003, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 267);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 0, 44, 0, 0, 0, 105801, 80003, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 268);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 13, "", 1, 38, 0, 0, 0, 105901, 80003, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 269);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 0, 45, 0, 0, 0, 105801, 80003, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 270);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 2, 53, 0, 0, 0, 106001, 80003, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 271);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 0, 46, 0, 0, 0, 105801, 80003, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 272);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 18, 0, 0, 0, 190801, 80003, "こんにちは\n【ギルド管理協会】のカリンです", 273);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 19, 0, 0, 0, 190801, 80003, "昨日の生放送は\nいかがだったでしょうか？", 274);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 20, 0, 0, 0, 190801, 80003, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 275);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 21, 0, 0, 0, 190801, 80003, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 276);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 22, 0, 0, 0, 190801, 80003, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 277);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 23, 0, 0, 0, 190801, 80003, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 278);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 24, 0, 0, 0, 190801, 80003, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 279);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 25, 0, 0, 0, 190801, 80003, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 280);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 26, 0, 0, 0, 190801, 80003, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 281);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 14, "", 0, 27, 0, 0, 0, 190801, 80003, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 282);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 47, 0, 0, 0, 105801, 80003, "準備はいいですかっ？\n…いっきますよー！", 283);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 54, 0, 0, 0, 106001, 80003, "祝！", 284);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 39, 0, 0, 0, 105901, 80003, "2.5周年！", 285);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 48, 0, 0, 0, 105801, 80003, "おめでとうございま～す☆", 286);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 55, 0, 0, 0, 106001, 80003, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 287);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 40, 0, 0, 0, 105901, 80003, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 288);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 49, 0, 0, 0, 105801, 80003, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 289);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 56, 0, 0, 0, 106001, 80003, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 290);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 41, 0, 0, 0, 105901, 80003, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 291);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 57, 0, 0, 0, 106001, 80003, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 292);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 50, 0, 0, 0, 105801, 80003, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 293);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 58, 0, 0, 0, 106001, 80003, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 294);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 51, 0, 0, 0, 105801, 80003, "記念日だから\n平気平気♪\nやばいですね☆", 295);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 59, 0, 0, 0, 106001, 80003, "意味分かんないわよ！", 296);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 42, 0, 0, 0, 105901, 80003, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 297);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 43, 0, 0, 0, 105901, 80003, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 298);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 52, 0, 0, 0, 105801, 80003, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 299);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 2, 60, 0, 0, 0, 106001, 80003, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 300);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 1, 44, 0, 0, 0, 105901, 80003, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 301);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 0, 53, 0, 0, 0, 105801, 80003, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 302);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ・コッコロ・キャル", 15, "105901,45,106001,61", 0, 54, 0, 0, 1, 105801, 80003, "2.5周年\nありがとうございます！", 303);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 0, "", 1, 1, 1, 0, 0, 190804, 60002, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 304);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60002, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 305);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60002, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 306);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60002, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 307);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60002, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 308);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 1, 0, 0, 60002, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 309);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60002, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 310);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60002, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 311);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60002, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 312);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60002, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 313);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 2, 0, 0, 60002, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 314);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60002, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 315);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60002, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 316);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60002, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 317);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60002, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 318);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60002, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 319);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60002, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 320);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 3, 0, 0, 60002, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 321);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60002, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 322);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60002, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 323);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60002, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 324);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60002, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 325);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60002, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 326);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 4, 0, 0, 60002, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 327);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 4, 0, 0, 60002, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 328);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 0, "", 3, 2, 0, 0, 0, 190804, 60002, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 329);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 7, "", 3, 3, 0, 0, 0, 190804, 60002, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 330);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 4, 1, 0, 0, 0, 105901, 80005, "ささ、シェフィさまはこちらへ…", 331);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 1, "", 0, 1, 0, 0, 0, 106401, 80005, "コッコロさん、どこへ行くの…？\n…え？", 332);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 3, 1, 0, 0, 0, 105801, 80005, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 333);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 1, "", 4, 2, 0, 0, 0, 105901, 80005, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 334);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 1, "", 0, 2, 0, 0, 0, 106401, 80005, "ええと…\n二人とも何をしているの？", 335);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 1, "", 1, 1, 0, 0, 0, 106001, 80005, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 336);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 1, "", 0, 3, 0, 0, 0, 106401, 80005, "あの日…？", 337);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 3, 2, 0, 0, 0, 105801, 80005, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 338);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 3, 3, 0, 0, 0, 105801, 80005, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 339);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 1, "", 2, 1, 0, 0, 0, 190801, 80005, "やばいですね☆", 340);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 1, "", 1, 2, 0, 0, 0, 106001, 80005, "って、なにしれっと\n参加してんのよカリン！", 341);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 1, "", 2, 2, 0, 0, 0, 190801, 80005, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 342);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 1, "", 2, 3, 0, 0, 0, 190801, 80005, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 343);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 1, "", 3, 4, 0, 0, 0, 105801, 80005, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 344);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 1, "", 0, 4, 0, 0, 0, 106401, 80005, "えっ！？　ええとええと…！\nあ、あと14日…！", 345);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 2, "", 3, 5, 0, 0, 0, 105801, 80005, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 346);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 2, "", 1, 3, 0, 0, 0, 105901, 80005, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 347);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 2, "", 1, 4, 0, 0, 0, 105901, 80005, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 348);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 2, "", 3, 6, 0, 0, 0, 105801, 80005, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 349);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 2, "", 1, 5, 0, 0, 0, 105901, 80005, "さすがでございます\nペコリーヌさま", 350);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 3, 0, 0, 0, 106001, 80005, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 351);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 2, "", 2, 5, 0, 0, 0, 106401, 80005, "しゃなり、しゃなり…\nふふ、案外できるものね", 352);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 2, "", 3, 7, 0, 0, 0, 105801, 80005, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 353);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 2, "", 1, 6, 0, 0, 0, 105901, 80005, "さ、次はキャルさまの\n番でございますよ", 354);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 4, 0, 0, 0, 106001, 80005, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 355);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 2, "", 2, 6, 0, 0, 0, 106401, 80005, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 356);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 5, 0, 0, 0, 106001, 80005, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 357);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 6, 0, 0, 0, 106001, 80005, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 358);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 2, "", 1, 7, 0, 0, 0, 105901, 80005, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 359);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 2, "", 0, 7, 0, 0, 0, 106001, 80005, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 360);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 1, 8, 0, 0, 0, 105901, 80005, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 361);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 3, 8, 0, 0, 0, 105801, 80005, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 362);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 1, 9, 0, 0, 0, 105901, 80005, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 363);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 3, "", 2, 7, 0, 0, 0, 106401, 80005, "聖学祭…って、なにかしら？", 364);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 3, "", 1, 10, 0, 0, 0, 105901, 80005, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 365);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 3, "", 0, 8, 0, 0, 0, 106001, 80005, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 366);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 3, "", 0, 9, 0, 0, 0, 106001, 80005, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 367);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 3, 9, 0, 0, 0, 105801, 80005, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 368);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 3, "", 0, 10, 0, 0, 0, 106001, 80005, "いや、そのまんますぎでしょ…", 369);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 3, "", 2, 8, 0, 0, 0, 106401, 80005, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 370);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 3, "", 3, 10, 0, 0, 0, 105801, 80005, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 371);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 3, "", 2, 9, 0, 0, 0, 106401, 80005, "えっ？　ええ…\nぎゅーっ…？", 372);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 0, 11, 0, 0, 0, 106001, 80005, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 373);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 4, "", 2, 10, 0, 0, 0, 106401, 80005, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 374);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 0, 12, 0, 0, 0, 106001, 80005, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 375);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 4, "", 1, 11, 0, 0, 0, 105901, 80005, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 376);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 0, 13, 0, 0, 0, 106001, 80005, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 377);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 3, 11, 0, 0, 0, 105801, 80005, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 378);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 0, 14, 0, 0, 0, 106001, 80005, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 379);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 0, 15, 0, 0, 0, 106001, 80005, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 380);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 4, "", 2, 11, 0, 0, 0, 106401, 80005, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 381);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 4, "", 3, 12, 0, 0, 0, 105801, 80005, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 382);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 4, "", 1, 12, 0, 0, 0, 105901, 80005, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 383);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 4, "", 0, 16, 0, 0, 0, 106001, 80005, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 384);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 4, "", 2, 12, 0, 0, 0, 106401, 80005, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 385);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 13, 0, 0, 0, 105801, 80005, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 386);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 14, 0, 0, 0, 105801, 80005, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 387);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 15, 0, 0, 0, 105801, 80005, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 388);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 17, 0, 0, 0, 106001, 80005, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 389);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 18, 0, 0, 0, 106001, 80005, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 390);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 5, "", 2, 13, 0, 0, 0, 106401, 80005, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 391);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 5, "", 1, 13, 0, 0, 0, 105901, 80005, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 392);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 16, 0, 0, 0, 105801, 80005, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 393);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 5, "", 0, 19, 0, 0, 0, 106001, 80005, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 394);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 17, 0, 0, 0, 105801, 80005, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 395);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 18, 0, 0, 0, 105801, 80005, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 396);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 5, "", 3, 19, 0, 0, 0, 105801, 80005, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 397);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 6, "", 2, 4, 0, 0, 0, 190801, 80005, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 398);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 6, "", 2, 5, 0, 0, 0, 190801, 80005, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 399);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 1, 20, 0, 0, 0, 106001, 80005, "…えっ！？", 400);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 6, "", 3, 20, 0, 0, 0, 105801, 80005, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 401);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 6, "", 0, 14, 0, 0, 0, 106401, 80005, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 402);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 6, "", 4, 14, 0, 0, 0, 105901, 80005, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 403);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 6, "", 0, 15, 0, 0, 0, 106401, 80005, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 404);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 1, 21, 0, 0, 0, 106001, 80005, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 405);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 6, "", 3, 21, 0, 0, 0, 105801, 80005, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 406);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 6, "", 1, 22, 0, 0, 0, 106001, 80005, "ぶっ殺すぞ！？", 407);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 6, "", 2, 6, 0, 0, 0, 190801, 80005, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 408);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 7, "", 1, 15, 0, 0, 0, 105901, 80005, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 409);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 23, 0, 0, 0, 106001, 80005, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 410);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 7, "", 2, 16, 0, 0, 0, 106401, 80005, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 411);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 7, "", 3, 22, 0, 0, 0, 105801, 80005, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 412);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 24, 0, 0, 0, 106001, 80005, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 413);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 7, "", 2, 17, 0, 0, 0, 106401, 80005, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 414);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 7, "", 1, 16, 0, 0, 0, 105901, 80005, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 415);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 7, "", 2, 18, 0, 0, 0, 106401, 80005, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 416);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 7, "", 1, 17, 0, 0, 0, 105901, 80005, "もちろんでございます\n仲良くお勉強いたしましょう", 417);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 25, 0, 0, 0, 106001, 80005, "しれっと教育ママが\n生まれてる…？", 418);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 7, "", 3, 23, 0, 0, 0, 105801, 80005, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 419);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 7, "", 0, 26, 0, 0, 0, 106001, 80005, "え～～～～！？", 420);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 8, "", 0, 27, 0, 0, 0, 106001, 80005, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 421);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 8, "", 2, 19, 0, 0, 0, 106401, 80005, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 422);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 1, 18, 0, 0, 0, 105901, 80005, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 423);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 8, "", 3, 24, 0, 0, 0, 105801, 80005, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 424);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 8, "", 2, 20, 0, 0, 0, 106401, 80005, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 425);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 8, "", 0, 28, 0, 0, 0, 106001, 80005, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 426);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 8, "", 1, 19, 0, 0, 0, 105901, 80005, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 427);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 8, "", 2, 21, 0, 0, 0, 106401, 80005, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 428);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 8, "", 0, 29, 0, 0, 0, 106001, 80005, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 429);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 8, "", 0, 30, 0, 0, 0, 106001, 80005, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 430);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 8, "", 3, 25, 0, 0, 0, 105801, 80005, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 431);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 8, "", 0, 31, 0, 0, 0, 106001, 80005, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 432);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 22, 0, 0, 0, 106401, 80005, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 433);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 23, 0, 0, 0, 106401, 80005, "…えっ？\n生放送の意気込み！？\n突然なに！？", 434);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 24, 0, 0, 0, 106401, 80005, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 435);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 25, 0, 0, 0, 106401, 80005, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 436);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 26, 0, 0, 0, 106401, 80005, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 437);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 27, 0, 0, 0, 106401, 80005, "それから、それから…！\nぅ、ぅぅっ…！", 438);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 28, 0, 0, 0, 106401, 80005, "―びえぇぇ～んっ！！！", 439);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 9, "", 1, 20, 0, 0, 0, 105901, 80005, "どうされましたか、シェフィさま", 440);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 29, 0, 0, 0, 106401, 80005, "ううっ…ひっく…\nママッ…！", 441);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 9, "", 1, 21, 0, 0, 0, 105901, 80005, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 442);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 9, "", 1, 22, 0, 0, 0, 105901, 80005, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 443);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 9, "", 0, 30, 0, 0, 0, 106401, 80005, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 444);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 23, 0, 0, 0, 105901, 80005, "主さま\n3.5周年まであと５日\nでございます", 445);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 24, 0, 0, 0, 105901, 80005, "ですがその前に\n生放送がありますね", 446);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 25, 0, 0, 0, 105901, 80005, "…生放送に向けた\n意気込みでございますか？", 447);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 26, 0, 0, 0, 105901, 80005, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 448);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 27, 0, 0, 0, 105901, 80005, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 449);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 28, 0, 0, 0, 105901, 80005, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 450);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 29, 0, 0, 0, 105901, 80005, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 451);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 30, 0, 0, 0, 105901, 80005, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 452);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 10, "", 0, 31, 0, 0, 0, 105901, 80005, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 453);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 26, 0, 0, 0, 105801, 80005, "3.5周年まであと４日！\nやばいですね☆", 454);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 11, "", 1, 32, 0, 0, 0, 106001, 80005, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 455);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 27, 0, 0, 0, 105801, 80005, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 456);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 28, 0, 0, 0, 105801, 80005, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 457);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 29, 0, 0, 0, 105801, 80005, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 458);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 11, "", 1, 33, 0, 0, 0, 106001, 80005, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 459);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 30, 0, 0, 0, 105801, 80005, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 460);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 31, 0, 0, 0, 105801, 80005, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 461);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 32, 0, 0, 0, 105801, 80005, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 462);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 11, "", 1, 34, 0, 0, 0, 106001, 80005, "だからあたしはやるなんて一言も…", 463);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 11, "", 0, 33, 0, 0, 0, 105801, 80005, "オイッスー☆", 464);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 11, "", 1, 35, 0, 0, 0, 106001, 80005, "聞きなさいっての！！", 465);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 12, "", 2, 31, 0, 0, 0, 106401, 80005, "3.5周年まであと３日…\nそして生放送は、明日…", 466);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 12, "", 2, 32, 0, 0, 0, 106401, 80005, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 467);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 12, "", 2, 33, 0, 0, 0, 106401, 80005, "おいっす！\n…こうじゃなかったわね\nええと確か…", 468);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 12, "", 2, 34, 0, 0, 0, 106401, 80005, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 469);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 12, "", 2, 35, 0, 0, 0, 106401, 80005, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 470);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 12, "", 3, 34, 0, 0, 0, 105801, 80005, "やってますねシェフィちゃん！", 471);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 12, "", 0, 36, 0, 0, 0, 106001, 80005, "なによ、考えることは\nみんな同じってこと？", 472);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 12, "", 1, 32, 0, 0, 0, 105901, 80005, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 473);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 12, "", 2, 36, 0, 0, 0, 106401, 80005, "みんな…もちろんよ！", 474);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 12, "", 3, 35, 0, 0, 0, 105801, 80005, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 475);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 13, "", 2, 7, 0, 0, 0, 190801, 80005, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 476);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 13, "", 2, 8, 0, 0, 0, 190801, 80005, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 477);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 3, 36, 0, 0, 0, 105801, 80005, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 478);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 13, "", 2, 9, 0, 0, 0, 190801, 80005, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 479);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 13, "", 4, 33, 0, 0, 0, 105901, 80005, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 480);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 13, "", 2, 10, 0, 0, 0, 190801, 80005, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 481);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 1, 37, 0, 0, 0, 106001, 80005, "大丈夫…大丈夫…\nあたしは大丈夫…", 482);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 13, "", 2, 11, 0, 0, 0, 190801, 80005, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 483);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 13, "", 0, 37, 0, 0, 0, 106401, 80005, "あうー？", 484);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("みんな", 13, "105901,34,106001,38,190801,12", 4, 37, 0, 0, 1, 105801, 80005, "あ…", 485);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 13, "", 1, 39, 0, 0, 0, 106001, 80005, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 486);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 13, "", 4, 35, 0, 0, 0, 105901, 80005, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 487);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 13, "", 3, 38, 0, 0, 0, 105801, 80005, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 488);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 13, "", 2, 13, 0, 0, 0, 190801, 80005, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 489);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 14, "", 2, 38, 0, 0, 0, 106401, 80005, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 490);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 14, "", 3, 39, 0, 0, 0, 105801, 80005, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 491);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 14, "", 0, 40, 0, 0, 0, 106001, 80005, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 492);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 14, "", 1, 36, 0, 0, 0, 105901, 80005, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 493);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 14, "", 2, 39, 0, 0, 0, 106401, 80005, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 494);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 14, "", 3, 40, 0, 0, 0, 105801, 80005, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 495);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 14, "", 1, 37, 0, 0, 0, 105901, 80005, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 496);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 14, "", 0, 41, 0, 0, 0, 106001, 80005, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 497);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 14, "", 2, 40, 0, 0, 0, 106401, 80005, "へ、へぇ…", 498);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 14, "", 3, 41, 0, 0, 0, 105801, 80005, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 499);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 14, "", 2, 41, 0, 0, 0, 106401, 80005, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 500);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 14, "", 2, 42, 0, 0, 0, 106401, 80005, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 501);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 3, 42, 0, 0, 0, 105801, 80005, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 502);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 1, 42, 0, 0, 0, 106001, 80005, "祝！", 503);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 4, 38, 0, 0, 0, 105901, 80005, "3.5周年！", 504);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 15, "", 0, 43, 0, 0, 0, 106401, 80005, "おめでとうございます！", 505);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 15, "", 2, 14, 0, 0, 0, 190801, 80005, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 506);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 15, "", 2, 15, 0, 0, 0, 190801, 80005, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 507);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 3, 43, 0, 0, 0, 105801, 80005, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 508);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 3, 44, 0, 0, 0, 105801, 80005, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 509);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 1, 43, 0, 0, 0, 106001, 80005, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 510);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("キャル", 15, "", 1, 44, 0, 0, 0, 106001, 80005, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 511);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 15, "", 0, 44, 0, 0, 0, 106401, 80005, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 512);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("シェフィ", 15, "", 0, 45, 0, 0, 0, 106401, 80005, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 513);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 4, 39, 0, 0, 0, 105901, 80005, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 514);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 4, 40, 0, 0, 0, 105901, 80005, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 515);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("コッコロ", 15, "", 4, 41, 0, 0, 0, 105901, 80005, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 516);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("ペコリーヌ", 15, "", 3, 45, 0, 0, 0, 105801, 80005, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 517);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("みんな", 15, "105901,42,106001,45,106401,46,190801,16", 4, 46, 0, 0, 1, 105801, 80005, "これからも\nよろしくおねがいします！", 518);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("カリン", 0, "", 1, 1, 1, 0, 0, 190804, 60003, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 519);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60003, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 520);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60003, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 521);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60003, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 522);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 1, 0, 0, 60003, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 523);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 1, 0, 0, 60003, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 524);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60003, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 525);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60003, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 526);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60003, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 527);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 2, 0, 0, 60003, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 528);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 2, 2, 0, 0, 60003, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 529);
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES ("", 0, "", 2, 0, 1, 3, 0, 0, 60003, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 530);
